import React, { Component } from 'react'
import {NavLink} from 'react-router-dom'

export class Navigation extends Component {
    render() {
        return (
            <ul className='nav'>
                <li><NavLink activeClassName = 'active' className = 'link' exact to = '/'><span className='spanNav'>Home</span></NavLink></li>
                <li><NavLink activeClassName = 'active' className = 'link' exact to = '/AboutMe'><span className='spanNav'>AboutMe</span></NavLink></li>
                <li><NavLink activeClassName = 'active' className = 'link' exact to = '/Projects'><span className='spanNav'>Projects</span></NavLink></li>
                <li><NavLink activeClassName = 'active' className = 'link' exact to = '/ContactMe'><span className='spanNav'>Contact</span></NavLink></li>
            </ul>
        )
    }
}

export default Navigation
